import { Route } from "react-router-dom";
import RHSPatient from "./RHSPatient";
import Profile from "./Profile";



const LHSPatient = () =>{
  
  function abc(){
    return (
      <Route path="profile" element={<Profile/>}/>        
    ); 

  }

    return (
        <>
        <div>
            <button type="button" onClick={abc} className="btn btn-light Btn-Custom-Size ">
              Profile
            </button>
          </div>
          <div>
            <button type="button" onClick={abc} className="btn btn-light Btn-Custom-Size">
              Appointment
            </button>
          </div>
          <div>
            <button type="button" className="btn btn-light Btn-Custom-Size">
              Booking History
            </button>
          </div>
          <div>
            <button type="button" className="btn btn-light Btn-Custom-Size">
              LogOut
            </button>
          </div>
        </>
    );

}

export default LHSPatient;
